import React from 'react';
import './App.css';
import HelloWorld from './HelloWorld';
import Button from 'react-bootstrap/Button';
import { useState } from 'react';

/* structures */

const user = {
    username: 'Testovichok',
    imageUrl: 'https://img.mobiuspace.com/image/aigc/3fcfc0bb01cbbdb5d39ade3ef35b8018_512_512.webp',
    imageSize: 250,
    name: 'Тест',
    last_name: 'Тестовый',
    gender: 1,
    city:'Москва',
    adress: 'Ул. Пушкина',
    build: 'дом Колотушкина'
}




function App(){
    return(
            <div className="App">
                <Profile/>
            </div>
        );
}


function CountButton()
{
    const [count, setCount] = useState(0);


    return (
            <button onClick={() => {setCount(count => count++); setCount(count => count++);}}>
                How many we click: {count} times
            </button>
    );
}


